import React, { useState } from 'react';
import { Grid, Image, List, Divider } from 'semantic-ui-react'

const _SearchMovieListDisplay = (props) => {

    return (
        <React.Fragment>
            <Grid>
                <Grid.Column width={5}>
                    <h3>{props.movie.original_title || props.movie.name}</h3>
                    <center className="customImageDisplay">
                        <Image src={props.movieImage} className="sizeOfNewSearchMovie" />
                    </center>
                </Grid.Column>
                <Grid.Column width={11}>
                    <h3>{props.movie.overview}</h3>
                </Grid.Column>
            </Grid>
        </React.Fragment >
    )
}

export default _SearchMovieListDisplay;
